import "./App.css";
import Cards from "./components/Cards/Cards.jsx";
import Nav from "./components/Nav/Nav.jsx";

function App() {
  const [characters, setCharacters] = useState([]);
  return (
    <div className="App" style={{ padding: "25px" }}>
      <Nav />
      <hr />

      <div>
        <Cards characters={characters} />
      </div>
    </div>
  );
}

export default App;
